import React from "react";

const ToDo = ({ itemName, onDelete }) => {
  return (
    <div>
      <text>{itemName}</text>
      <button onClick={onDeleteToDo}>done!</button>
    </div>
  );
};

onDeleteToDo = () => {
  onDelete(itemName);
};

export default ToDo;
